const tintColor = '#2f95dc';

export default {
  tintColor,
  tabIconDefault: "#ccc",
  tabIconSelected: tintColor,
  tabBar: "#fefefe",
  errorBackground: "da2c38",
  errorText: "#fff",
  warningBackground: "#eca400",
  warningText: "#666804",
  noticeBackground: tintColor,
  noticeText: "#fff",
};
